  blueprint_courses_create_edit_associate_delete_bf41988e: "Blueprint (skapa/redigera/associera/ta bort)"
  blueprint_courses_is_an_account_level_feature_opti_38676924: "Kursmallar är ett funktionsalternativ på kontonivå. Kursroller kan endast hantera kursmallar om de läggs till i kursmallen som en lärar-, lärarassistent- eller designerroll. Om du vill öppna sidofältet för kursmallar måste Kurser – lägg till/redigera/ta bort kurser vara aktiverat. Om du vill lägga till en associerad kurs måste även Kurser – visa lista och Kurser – lägg till/redigera/ta bort vara aktiverat. Om du vill redigera låsinställningar på modellobjekttyper måste även Kurser – lägg till/redigera/ta bort vara aktiverat."
  blueprint_courses_is_an_account_level_feature_opti_390ed2e7: "Kursmallar är ett funktionsalternativ på kontonivå. För att lägga till kopplade kurser måste även Blueprint-kurser – lägg till/redigera/koppla/ta bort samt Kurser – lägg till/redigera/ta bort aktiveras."
  blueprint_courses_is_an_account_level_feature_opti_3a0161d3: "Kursmallar är ett funktionsalternativ på kontonivå. Kursroller kan endast hantera Blueprint-kurser om de läggs till i Blueprint-kursen med lärar-, TA- eller designerroll. Om du vill öppna sidofältet för kursmallar måste Kurser – lägg till/redigera/ta bort kurser vara aktiverat. Om du vill lägga till en associerad kurs måste även Kurser – visa lista och Kurser – lägg till/redigera/ta bort vara aktiverat. Om du vill redigera låsinställningar på modellobjekttyper måste även Kurser – lägg till/redigera/ta bort vara aktiverat."
  blueprint_courses_is_an_account_level_feature_opti_3bf307d: "Kursmallar är ett funktionsalternativ på kontonivå. För att redigera modellers låsinställningar på indexeringssidan för diskussioner måste även Kurser – lägg till/redigera/ta bort och Diskussioner – visa vara aktiverat. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort och Diskussioner – visa är aktiverat, kan låsinställningar för modeller redigeras för enskilda diskussioner."
  blueprint_courses_is_an_account_level_feature_opti_4c34e5d3: "Blueprint-kurser är ett funktionsalternativ på kontonivå. För att redigera Blueprint-låsinställningar från indexsidan för uppgifter måste även Kurser – lägg till/redigera/ta bort aktiveras. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort är aktiverad, kan Blueprint-låsinställningar för en uppgift hanteras från informationssidan för uppgiften. För att redigera Blueprint-låsinställningar i ett individuellt quiz, eller på indexsidan för quiz måste även Kurser – lägg till/redigera/ta bort aktiveras."
  blueprint_courses_is_an_account_level_feature_opti_4c9fa399: |-
      Kursmallar är ett funktionsalternativ på kontonivå.
      Om du vill redigera låsinställningarna för modeller från indexeringssidan för uppgifter måste även Kurser – lägg till/redigera/ta bort vara aktiverat. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort är aktiverat, kan låsinställningar för modeller för en uppgift hanteras från uppgiftens informationssida.
      För att redigera modellers låsinställningar på ett enskilt quiz, eller på indexeringssidan för quiz, måste även Kurser – lägg till/redigera/ta bort vara aktiverat.
  blueprint_courses_is_an_account_level_feature_opti_580ba84e: |-
      Kursmallar är ett funktionsalternativ på kontonivå.
      För att redigera låsinställningar för modeller från indexeringssidan för uppgifter måste även Kurser – lägg till/redigera/ta bort vara aktiverat. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort och Diskussioner – visa är aktiverat, kan låsinställningar för modeller redigeras på enskilda sidor.
  blueprint_courses_is_an_account_level_feature_opti_6c9b5baf: "Kursmallar är ett funktionsalternativ på kontonivå. För att redigera Blueprint-kursinställningar i Kursinställningar måste även Blueprint-kurser – lägg till/redigera/koppla/ta bort aktiveras. För att lägga till en kopplad kurs måste även Blueprint-kurser – lägg till/redigera/koppla/ta bort samt Kurser – visa lista aktiveras. För att redigera låsinställningar på modellobjekttyper måste den här behörigheten vara aktiverad. För att redigera låsinställningarna på filer måste även Kursfiler – lägg till/redigera/ta bort vara aktiverat. För att redigera låsinställningarna för quiz måste även Uppgifter och Quiz – lägg till/redigera/ta bort vara aktiverat."
  blueprint_courses_is_an_account_level_feature_opti_8429207: "Kursmallar är ett funktionsalternativ på kontonivå. För att redigera kursmallinställningar i Kursinställningar måste även Kursmallar – lägg till/redigera/ta bort vara aktiverat. För att lägga till en associerad kurs måste även Kursmallar – lägg till/redigera/associera/ta bort och Kurser – visa lista vara aktiverade. För att redigera låsinställningar på modellobjekttyper måste den här behörigheten vara aktiverad. För att redigera låsinställningarna på filer måste även Kursfiler – lägg till/redigera/ta bort vara aktiverat. För att redigera låsinställningarna för quiz måste även Uppgifter och Quiz – lägg till/redigera/ta bort vara aktiverat."
  blueprint_courses_is_an_account_level_feature_opti_8d968b0e: "Kursmallar är ett funktionsalternativ på kontonivå. För att redigera låsinställningarna från indexsidan Sidor måste även Kurser – lägg till/redigera/ta bort aktiveras. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort är aktiverad kan Blueprint-låsinställningar redigeras på enskilda sidor."
  blueprint_courses_is_an_account_level_feature_opti_a90144eb: |-
      Kursmallar är ett funktionsalternativ på kontonivå.
      
      För att lägga till associerade kurser måste även Kursmallar – lägga till/redigera/koppla/ta bort och Kurser – lägg till/redigera/ta bort vara aktiverade.
  blueprint_courses_is_an_account_level_feature_opti_c7e81929: "Kursmallar är ett funktionsalternativ på kontonivå. För att redigera Blueprint-låsinställningar från indexsidan Diskussioner måste även Kurs – lägg till/redigera/ta bort och Diskussioner – visa aktiveras. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort samt Diskussioner – visa är aktiverade kan Blueprint-låsinställningar redigeras på enskilda diskussioner."
  blueprint_courses_must_be_enabled_for_an_account_b_188041e1: |-
