  enrollments_may_be_added_by_your_institution_stude_213d41a4: |-
      Registreringar kan läggas till av din institutions elevinformationssystemet (Student Information System). Om en registrering skapas via SIS kan endast administratörer ta bort registreringen från kursen.
              Om kontoinställningen Öppen registrering är aktiverad kan användare med den här behörigheten lägga till observatörer till en kurs på sidan Kurspersoner via e-post eller inloggnings-ID även om observatören inte redan har ett Canvas-konto.
              För att länka en observatör till en elev måste behörigheterna Användare – hantera inloggningsuppgifter och Konversationer – skicka meddelanden till individuella kursmedlemmar vara aktiverade.
              För att generera en parkopplingskod på en elevs vägnar för delning med en observatör måste behörigheten Användare – generera observatörsparkopplingskod för elever vara aktiverad.
              För att se listan över observatörer i kursen måste behörigheten Användare – visa lista vara aktiverad.
              För att se SIS ID:er måste behörigheten SIS-data – läs vara aktiverad. För lägga till en observatör till en kurs via SIS-ID måste även SIS-data – hantera vara aktiverat.
