      what: 
        details1: |-
            ePortfolios är en plats där du kan visa och diskutera viktiga
            inlämningar och erfarenheter under inlärningsprocessen.
             Du kan använda en ePortfolio till att: 
            
            * Visa upp de uppsatser som du är stolt över för fler personer än bara läraren
            *. Dela dina tankar och det arbete du lagt ner på dina inlämningar
            * Får en översikt över dina inlärningsupplevelser
            * Dela dina arbeten med vänner, framtida arbetsgivare, m.m.
            
