      email: 
        body: |-
            Hej %{user}!
            
            %{course} Din Canvas Network-kurs började för ett par dagar sedan och vi har upptäckt att du ännu inte har loggat in. Vill vill bara påminna dig en sista gång i fall du har glömt det.
            
            Du loggar in genom att gå till %{site} och ange ditt användarnamn och lösenord. Om du inte har angett ett lösenord än kan du göra det här: %{password_url}
            
            Om du helt enkelt inte kan delta i den här kursen är du välkommen att söka i vår kurskatalog på %{site} efter något annat som kan inspirera dig. Nya kurser läggs till hela tiden!
            
