    grade_export: 
      description: "Export av omdöme till SIS"
      name: "Export av omdöme"
    grade_export_settings: 
      description: |-
          Denna plugin möjliggör publicering av slutbedömningar i ett elevinformationssystem (SIS).  Om aktiverat har användaren möjlighet att publicera bedömningarna i bedömningsöversikten.  Detta sker via POST-begäran till den angivna publiceringsslutpunkten.  Varje typ definierar sitt eget innehållsformat och mime-typ.  Svaret från slutpunkten har ingen betydelse och ignoreras för närvarande. 
          
          En Instructure-formaterad CSV-fil av MIME-typ kommer till exempel att publicera en CSV-fil med MIME-typ 'text/csv' till den angivna slutpunkten, med följande kolumner: 
          
          "publisher\_id", "publisher\_sis\_id", "course\_id", "course\_sis\_id", "section\_id", "section\_sis\_id", "student\_id", "student\_sis\_id", "enrollment\_id", "enrollment\_status", "score", "grade", "custom\_grade\_status"
          
          (Obs! Kolumnen "grade" returneras endast om kursen anger en bedömningsstandard) 
          
          För varje elev i kursen som publiceras kommer det att finnas en eller flera rader i den publicerade CSV-filen. Det finns 1 rad för varje inloggning som eleven har i kursens rotkonto.  Detta kommer oftast att resultera i en rad per elev, men om eleven har flera inloggningar kommer det att finnas en rad för varje. 
          
          Om kryssrutan "Inkludera åsidosättningar av slutbedömning" är markerad, och om funktionen för Åsidosättning av slutlig bedömning är aktiverad, får elever med ett åsidosatt bedömning/resultat detta istället för den beräknade poängen och bedömningen.  Om funktionen Anpassad statusetikett är aktiverad kommer kolumnen "custom\_grade\_status" att innehålla anpassade bedömningsstatusar tillämpade på åsidosättningar för slutbedömningar för den eleven.
      labels: 
        format_type: "Resultatets formattyp"
        include_final_grade_overrides: "Inkludera åsidosättningar av slutbedömning"
        publish_endpoint: "Slutpunkt att publicera till"
        success_timeout: "Tiden gick ut för meddelande om slutfört (i sekunder)"
        wait_for_success: "Vänta på meddelande om slutfört"
